import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import EventList from './components/EventList';
import EventForm from './components/EventForm';
import ParticipantList from './components/ParticipantList';
import './styles/App.css';

function App() {
  return (
    <Router>
      <div className="app-container">
        <nav>
          <ul>
            <li><Link to="/login">Login</Link></li>
            <li><Link to="/register">Register</Link></li>
            <li><Link to="/events">Event List</Link></li>
            <li><Link to="/events/create">Create Event</Link></li>
            <li><Link to="/participants">Participants</Link></li>
          </ul>
        </nav>
        <div className="content">
          <h1>Bem Vindo ao Gerenciador de Eventos</h1>
          <p> Este Ã© o gerenciador de eventos realizado por Luan Monteiro.</p>

          <div className="recent-events">
            <h2>Eventos Recentes</h2>


          </div>
          </div>
        <footer>
          <p>&copy; 2024 Gerenciador de Eventos por Luan Monteiro. Todos os direitos reservados.</p>
        </footer>

        <div className="content">
          <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/events" element={<EventList />} />
            <Route path="/events/create" element={<EventForm />} />
            <Route path="/participants" element={<ParticipantList />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
